import "bootstrap/dist/css/bootstrap.css";
import React, {useState} from "react";

function Navbar({viewer, setViewer}) {

    const updateHooks = (number) => {
        setViewer(number);
    }

    return (
        <div>
            <nav className="navbar navbar-expand-lg bg-body-tertiary">
                <div className="container-fluid">

                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navvbarNav" aria-expanded="false" aria-label="Toggle navigation" style={{marginLeft:'auto'}}>
                        <span className="navbar-toggler"></span>
                    </button>

                    <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
                        <ul>
                            <li className="nav-item" style={{display:'flex', justifyContent:'flex-end', marginTop:.5 + 'em', marginRight:1 + 'em'}}>
                                <button className={`nav-link ${viewer === 0 ? 'active' : ''}`} onClick={() => updateHooks(0)} aria-current="Home page">Home</button>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>
        </div>
    );
}

export default Navbar;
